import React, { useEffect } from "react";
import './Home.css'
import { useLocation } from "react-router-dom";
import Profile from "./Profile/Profile";
const Home=(props)=>{
    const location=useLocation();
    const {name,password,email,gender,cityName,residationType,society}=location.state || {};
    // useEffect(()=>{console.log(name,password,email,gender);},[])
    const clickedHandler=()=>{
        return <Profile cityName={cityName} residationType={residationType} society={society} address={true}></Profile>
    }
return(<div>
    <div className="container-home">
            <header>
                <nav>
                    <ul>
                        <li><a href="#">Home</a></li>
                    </ul>
                </nav>
            </header>
            <div className="profile-home">
            <Profile  name={name} email={email} password={password} gender={gender}/>
            <Profile clicked={clickedHandler} cityName={cityName} residationType={residationType} society={society} btn={true} address={true} ></Profile>
            </div>
            
       
    </div>
</div>)
}
export default Home;
